import React from "react"
import TeamMember from "./TeamMember";

function Team(){
    return(
        <div className="row">
            <TeamMember
            info = {
                {
                    img: '/images/dev2.jpg' ,
                    name: 'Taaif Ayaad',
                    position: 'Web Engineer',
                    phone: '0582926733',
                    email: 'taaif@gmail.com',
                    website: 'taaifayaad.com'
                }
            }  
            />
            <TeamMember
            info = {
                {
                    img: '/images/dev1.png' ,
                    name: 'Ahamed Khalid',
                    position: 'Web Engineer',
                    phone: '0509193837',
                    email: 'taaif@gmail.com',
                    website: 'taaifayaad.com'
                }
            }  
            />
        </div>
    );
}

export default Team ;
